import React from 'react'

import Crew from './Crew'

function CrewList(props){
    const crew_list = props.crews.map((crew, i) => <Crew key={i} id={crew.id} callback={props.callback} members={crew.members} memberclick={props.memberclick} selected={props.selected}/>)
    return(
        <div className="crew-list">
            {crew_list}
            <h2 className="add-crew">Add crew</h2>
        </div>
    )
}
export default CrewList
